import React, {useState} from 'react';
import './App.css';

function App(){

    const [count, setCount] = useState(true);

    return (
      <div>
        <h1>You clicked {count} times!</h1>
        <input type="checkbox" checked={count} onClick={() => setCount(!count)}/>
        <h1>{toString(count)}</h1>
      </div>
    );
}



export default App;
